	public static void log( String query ) throws Exception
	{
		BufferedWriter bw = null;
		
		try
		{
			File file = new File( "/Users/sathish-1343/temporaryFiles/query.log" );
			
			// if file doesnt exists, then create it and if directories doesnt exist, create it.
			if (!file.exists()) {
				file.getParentFile().mkdirs();
				file.createNewFile();
			}

			FileWriter fw = new FileWriter( file.getAbsoluteFile(), true );
			bw = new BufferedWriter(fw);
			
			
			bw.write( query );
			bw.newLine();
		}
		finally
		{
			if ( bw != null )
			{
				bw.close();
			}
		}
	}
